    Conducted by Administrative Law Judges, Rule Making, Rules of Practice, and Agencies
    Administering the statute. Contains Statuary Decision Opinions of the United State
    Department of Agriculture Office of Administrative law Judges and Judicial Officer.
    There are approximately 40 statutes administered by agencies within the Department
    of Agriculture that require Administrative Procedure Act (APA) hearings. The Judges
    issue initial decisions and orders in adjudicatory proceedings which become final
    decisions of the Secretary unless appealed to the Secretary's Judicial Officer by
